const router = require('express').Router();
const {User} = require('../../db/models');
const {Them} = require('../../db/models');
const {Fish} = require('../../db/models');
const bcrypt = require('bcrypt');


router.route('/fishes')
.get( async (req, res) => {
    try {
        const fishes = await Fish.findAll({raw: true});
        res.json(fishes);
    } catch (err) {
       res.json({message: err.message}); 
    }
})


router.route('/thems')
.get( async (req, res) => {
 try {
    const thems = await Them.findAll({raw: true});
    res.json(thems);
 } catch (err) {
    res.json({message: err.message});
 }
})


router.route('/logout')
.get((req, res) => {
    res.clearCookie('user_sid');
    res.json({message: 'ok'})
})


router.route('/log')
.put(async (req, res) => {
    try {
       const {email, password} = req.body;
      if(!email || !password ) {res.json({message: 'LENGTH'}); return };
       const user = await User.findOne({where: {email}, raw: true});
       if(user){
        const ok = await bcrypt.compare(password, user.password);
        if(ok){
            req.session.userName = user.name;
            req.session.userId = user.id;
            res.json({message: 'ok', name: user.name, id: user.id});
        }
        else{
            res.json({message: 'ERR'});
        }
       } 
       else{
        res.json({message: 'ERR'});
    }
    } catch (err) {
       res.json({message: err.message}); 
    }
})


router.route('/checkUser')
.get( async (req, res) => {
try {
  const {userId, userName} = req.session; 
const user = await User.findOne({where: {id: userId}, raw: true});
user ? res.json({message: 'ok', name: userName, id: userId}) : res.json({message: 'fig'});
} catch (err) {
    res.json({message: err.message});
}
})

router.route('/reg')
.post( async (req, res) => {

try {
    const {name, email, password} = req.body;
   if(!name || !email || ! password){res.json({ message: 'LENGTH'}); return}
    const user = await User.findOne({where: {email}});
    if(user){res.json({ message: 'OLD'}); return};
    const hash = await bcrypt.hash(password, 10);
    const newUser = await User.create({name, password: hash, email});
        req.session.userId = newUser.id;
        req.session.userName = newUser.name;
    res.json({name: newUser.name, id: newUser.id, message: 'OK'});
} catch (err) {
   res.json({message: err.message});
}
})


router.route('/fishes')
.get( async (req, res) => {
    try {
        const fishes = await Fish.findAll({raw: true});
        res.json(fishes);
    } catch (error) {
        res.json({message: error.message});
    }
})


router.route('/main')
.get( async (req, res) => {
    try {
        const thems = await Them.findAll({raw: true});
        res.json(thems);
    } catch (error) {
        res.json({massage: error.massage})
    }
})

router.route('/users')
.get( async (req, res) => {
    try {
        const users = await User.findAll({raw: true});
        users ? res.json({message: users}) : res.json({message: 'fig'});
    } catch (error) {
        res.json({message: error.message});
    }
})

module.exports = router;

