const React = require('react');
const Layout = require('./Layout');

function NavBar({title, user}){

    return (

<div id='nav-bar'>

{user && <h4 id='hi' className='nav-item'>{`Привет,  ${user.name} !`}</h4>}

<a href='/' className='nav-item'>Main</a>
<a href='/products/1' className='nav-item'>Products</a>
{user && user.status === 'sell' && <a href='/products/my/products' className='nav-item'>My products</a> } 
{! user && <p className='nav-item' style={{color: 'red'}}>войдите или зарегистрируйтесь!</p>}

{user && user.status === 'by' && <a href="/favorite" className='nav-item'>my favorite</a>}

